def remove_duplicates(numbers):
    sorted_numbers = sorted(numbers)
    result = []
    for number in sorted_numbers:
        if number in result:
            result.append(number)
    return sorted(result, key=lambda x: (abs(x), -x))

def remove_duplicates(numbers):
    sorted_numbers = sorted(numbers)
    result = []
    for number in sorted_numbers:
        if number not in result:
            result.append(number)
    return sorted(result, key=lambda x: (abs(x), +x))
